import React from 'react';

const CTA = () => {
  return (
    <>

      <section className="cta-section">
        <div className="cta-content">
          <div className="cta-text">
            <h1 style={{ color: 'white' }}>Take the Next Step</h1>
            <p className="section-subtitle" style={{ color: 'white' }}>Get started with our services today!</p>
          </div>
          <div className="cta-buttons">
            <button className="cta-button">
              Schedule a Consultation
            </button>
            <button className="cta-button">
              Get a Free Quote
            </button>
            <button className="cta-button">
              Start a Project
            </button>
          </div>
        </div>
      </section>

      <style jsx>{`
        .cta-section {
          padding: 100px 0;
          background-color: #00183d; 
        }

        .cta-content {
          max-width: 1200px;
          margin: 0 auto;
          padding: 0 20px;
          text-align: center;
        }

        .cta-text {
          margin-bottom: 40px;
        }

        .cta-buttons {
          display: flex;
          justify-content: space-between;
          align-items: center;
        }

        .cta-button {
          background-color: #01224a;
          color: white;
          border: none;
          padding: 10px 20px;
          border-radius: 10px;
          cursor: pointer;
          margin: 10px;
        }

        .cta-button:hover {
          background-color: #00183d;
        }
      `}</style>
    </>
  );
};

export default CTA;
